__NUXT_JSONP__("/drugs/CD16IL15CD33_Trispecific_Killer_Cell_Engager_OXS-3550", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"2094086-30-1",chebiId:b,chemicalFormula:b,definition:"A trispecific killer engager (TriKE) molecule containing an anti-cluster of differentiation 16 (CD16; FcgammaRIII) single-chain variable fragment (scFv) to engage natural killer (NK) cells, an anti-CD33 scFv to engage myeloid cells and a human modified interleukin-15 (IL-15) linker, that links the two scFv, with potential immunomodulating and antineoplastic activities against CD33-expressing tumor cells. Upon administration of the CD16\u002FIL15\u002FCD33 TriKE OXS-3550, the simultaneous binding to CD16 on NK cells and CD33 on tumor cells will induce NK cell cytotoxicity specifically against CD33-expressing tumor cells. The cytokine  IL-15 linker promotes NK cell proliferation, activity, survival and expansion. CD33 is expressed on normal non-pluripotent hematopoietic stem cells and is overexpressed on myeloid leukemia cells.",fdaUniiCode:"E5GE91Q5FX",identifier:"C151948",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129820"],synonyms:["161533","161533 TRIKE","CD16\u002FIL-15\u002FCD33 161533 Tri-Specific Killer Engagers","CD16\u002FIL15\u002FCD33 TriKE OXS-3550",c,"OXIS3550","OXS 3550","OXS-3550","OXS3550"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FCD16IL15CD33_Trispecific_Killer_Cell_Engager_OXS-3550",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("CD16IL15CD33_Trispecific_Killer_Cell_Engager_OXS-3550","","CD16\u002FIL15\u002FCD33 Trispecific Killer Cell Engager OXS-3550","2021-10-30T13:33:30.013Z")));